import React from 'react';

const LeftBar = () => {
    return (
        <div class="col-12 order-lg-first col-lg-3 pt-3">
            <h5>Done tasks</h5>
            <ul class="ml-0" id="task-list-done">
                // Placeholder for dynamic done tasks list 
            </ul>
            <h5>Deleted tasks</h5>
            <ul class="ml-0" id="task-list-deleted">
                // Placeholder for dynamic deleted tasks list 
            </ul>
            <button id="delete-all-tasks" class="btn btn-danger btn-sm" hidden>Delete permanently</button>
        </div>
    );
}

export default LeftBar;
